import React from 'react';

import './Toolbar.css';

import DrawerToggle from '../Navigation/SideDrawer/DrawerToggle/DrawerToggle';

import NavigationItems from '../Navigation/NavigationItems/NavigationItems';

const Toolbar = (props) => {
  if (props.token) {
    return 'dummy'
  }

  // return (
